  `dept` varchar(45) DEFAULT NULL,
  `year` varchar(45) DEFAULT NULL,
  `study_mode` varchar(45) DEFAULT NULL,
  `semester` varchar(45) DEFAULT NULL,
  `session` varchar(45) DEFAULT NULL,
  `stuId` varchar(15) NOT NULL,
  `cleared` tinyint(2) NOT NULL,
  `dateCreated` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `dateUpdated` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `id2_idx` (`stuId`),
  KEY `cl1_idx` (`cleared`),
  CONSTRAINT `id2` FOREIGN KEY (`stuId`) REFERENCES `stu_bio` (`jamb_num`) ON DELETE NO ACTION ON UPDATE CASCADE
